import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
    this.addFileToVFS('NotoSansArabic_SemiCondensed-Regular-normal.ttf', font);
    this.addFont('NotoSansArabic_SemiCondensed-Regular-normal.ttf', 'NotoSansArabic-Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])